import React from 'react';

const Menumap = (props) => {
    const {menuLinks}  = props
    return (
        menuLinks.map(({path, name}) => (
            <li key={name}>
              <Link href={path} as={path} >
                <a >{name}</a>
              </Link>
            </li>))
    );
};

const MobileMenuMap = (props) => {
    const {menuLinks}  = props
    return (
        menuLinks.map(({path, name}) => (
            <li key={name}>
              <Link href={path} as={path} >
                <a >{name}</a>
              </Link>
            </li>))
    );
};



export default {
  Menumap, MobileMenuMap
};
